import React from "react";
import './style.css';



function Sobre() {
     return(
         <section className="row">
              <div className="col-12 bg bg-primary teste4">
             <h1 className="">Mais do que simplesmente viajar!<br /></h1>
             <h3><span class="destaque">Viaje +</span>trabalha com roteiros culturais e historicos tornando sua viagem uma experiencia unica</h3>
             </div>
         </section>
     )
}

export default Sobre;
